import React from "react";

import classes from "./Button.module.css";

const Button = (props) => {
  console.log(props.isLight);
  const buttonClasses = props.isLight
    ? `${classes.button} ${classes["button--isLight"]} ${props.className}`
    : `${classes.button} ${classes["button--isDark"]} ${props.className}`;
  return <button className={buttonClasses}>{props.children}</button>;
};

export default Button;
